import React, { Component } from 'react'
import { Container, Header, Divider } from 'semantic-ui-react'


export default class Academia extends Component {

render() {
  const posts = require('../data/projects.json');
  const t = posts.map(element => 
    <li>
    <div className="post">
    <Container>
      <Header as='h3'>{element.title}</Header>
      <Header as='h6'>{element.organization}</Header>
      <p>
        {element.description}
      </p>
    </Container>
    </div>
    <Divider/>
    </li>
  );
  return (
    <Container className="post">
    {/* <Header as='h3'>About Me</Header> */}
    <p className='nicep'>
      I'm currently studying my Masters in Informatics. You can fine my cv <a className="cv" href="https://www.dropbox.com/s/n93tdnvyw2ban9u/CV.pdf?dl=0">here</a>.
    </p>
    <p>
      Here is also a list of projects that I've been working on lately:
      <ul>
      {t}
      </ul>
    </p>
  </Container>
  )
}
}
